import React,{ useState } from 'react'
import './About.css';
import PropTypes from 'prop-types'

export default function About(props) {
    
   
    //const[myStyle,setMyStyle]= useState({
      //  color:'white',
        //backgroundColor:'black'
       //})
let myStyle={
    color: props.mode==='dark'?'white':'black',
    backgroundColor: props.mode==='dark'?'#521683':'white'
}
 /*const[btnText,setBtnText]= useState("Enable Dark Mode")
const toggleStyle=()=>{
   if(myStyle.color==='white'){
        setMyStyle({
            color:'black',
        backgroundColor:'white',
        border: '1px solid white'
       })
        setBtnText("Enable Dark Mode")
    }
    else{
        setMyStyle({
            color:'white',
            backgroundColor:'black'
        })
        setBtnText("Enable Light Mode")
    }
}*/
  return (
    <>
    <div classname="b"style={myStyle}>
    <div className="container1" style={myStyle} >
        <h1>About Us</h1>
            <div className="accordion" id="accordionExample"style={myStyle}>
                    <div className="accordion-item"style={myStyle}>
                        <h2 className="accordion-header">
                        <button className="accordion-button" type="button" data-bs-toggle="collapse" data-bs-target="#collapseOne" aria-expanded="true" aria-controls="collapseOne"style={myStyle}>
                            Accordion Item #1
                        </button>
                        </h2>
                        <div id="collapseOne" className="accordion-collapse collapse show" data-bs-parent="#accordionExample"style={myStyle}>
                        <div className="accordion-body" style={myStyle}>
                            <strong>This is the first item's accordion body.</strong> It is shown by default, until the collapse plugin adds the appropriate classes that we use to style each element. These classes control the overall appearance, as well as the showing and hiding via CSS transitions. You can modify any of this with custom CSS or overriding our default variables. It's also worth noting that just about any HTML can go within the <code>.accordion-body</code>, though the transition does limit overflow.
                        </div>
                        </div>
                    </div>
                    <div className="accordion-item" style={myStyle}>
                        <h2 className="accordion-header" style={myStyle}>
                        <button className="accordion-button collapsed" type="button" data-bs-toggle="collapse" data-bs-target="#collapseTwo" aria-expanded="false" aria-controls="collapseTwo"style={myStyle}>
                            Accordion Item #2
                        </button>
                        </h2>
                        <div id="collapseTwo" className="accordion-collapse collapse" data-bs-parent="#accordionExample"style={myStyle}>
                        <div className="accordion-body"style={myStyle}>
                            <strong>This is the second item's accordion body.</strong> It is hidden by default, until the collapse plugin adds the appropriate classes that we use to style each element. These classes control the overall appearance, as well as the showing and hiding via CSS transitions. You can modify any of this with custom CSS or overriding our default variables. It's also worth noting that just about any HTML can go within the <code>.accordion-body</code>, though the transition does limit overflow.
                        </div>
                        </div>
                    </div>
                    <div className="accordion-item" style={myStyle}>
                        <h2 className="accordion-header">
                        <button className="accordion-button collapsed" type="button" data-bs-toggle="collapse" data-bs-target="#collapseThree" aria-expanded="false" aria-controls="collapseThree" style={myStyle}>
                            Accordion Item #3
                        </button>
                        </h2>
                        <div id="collapseThree" className="accordion-collapse collapse" data-bs-parent="#accordionExample" style={myStyle}>
                        <div className="accordion-body" style={myStyle}>
                            <strong>This is the third item's accordion body.</strong> It is hidden by default, until the collapse plugin adds the appropriate classes that we use to style each element. These classes control the overall appearance, as well as the showing and hiding via CSS transitions. You can modify any of this with custom CSS or overriding our default variables. It's also worth noting that just about any HTML can go within the <code>.accordion-body</code>, though the transition does limit overflow.
                        </div>
                        </div>
                    </div>
                </div>
                {/* <div className="container my-3">
               <button onClick={toggleStyle} className="btn btn-dark">{btnText}</button>
  </div> */}
</div>
 <div className="container1 my-4" style={myStyle} >A text utility website is an invaluable tool for anyone who regularly works with text, whether it's writing, editing, coding, or analyzing. These websites offer a collection of diverse and efficient tools designed to simplify and enhance various text-related tasks. From basic formatting and cleaning to advanced functions like text analysis and regular expression search, a text utility website empowers users to effortlessly manipulate and optimize their text content. With features such as text case conversion, character counting, sorting, and even translation, these websites save time and effort while ensuring accuracy and consistency in your textual endeavors. Whether you're a student, professional, developer, or content creator, a text utility website is a must-have resource in your digital toolkit.

 </div>
 </div>
 </>
  );
}
